// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// Platform currency -> erc20 transfer
contract NativeToERC20Handler is Ownable {
    // ResourceID
    bytes32 public resourceID;

    // Bridge contract address
    address public bridgeAddress;

    // Cross chain token contract address
    address public tokenAddress;

    // Erc20 handler address on the target chain
    address public targetHandler;

    // Burnable
    bool public burnable;

    event Received(address sender);

    // Allow the contract to receive tokens
    receive() external payable {
        emit Received(msg.sender);
    }

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        resourceID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Set up
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Deposit
    function deposit(bytes32 _resourceID, uint32 targetChainId)
        public
        payable
        returns (bytes32)
    {
        require(resourceID == _resourceID, "resourceID error");

        require(
            msg.value > 0,
            "condition: The transfer amount must be greater than 0 (msg.value > 0)"
        );

        uint256 amount = msg.value;
        require(msg.sender.balance >= amount, "Insufficient funds");

        if (burnable) {
            // burn
            Address.sendValue(payable(address(0)), amount);
        }
        //        else { This operation is not required. When the method is payable, it can be directly saved to the current contract
        //            payable(address(this)).transfer(msg.value); // lock
        //        }

        bytes memory data = abi.encode(msg.sender, amount);
        // Call bridge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    function execute(bytes32 _resourceID, bytes calldata data) public {
        require(resourceID == _resourceID, "resourceID error");
        uint256 amount;
        address sender;
        (sender, amount) = abi.decode(data, (address, uint256));
        if (burnable) {
            // mint
            IERC20Mintable erc20Mint = IERC20Mintable(tokenAddress);
            erc20Mint.mint(sender, amount);
        } else {
            // release
            IERC20 erc20 = IERC20(tokenAddress);
            erc20.transfer(sender, amount);
        }
    }

    // For testing
    function NativeBalanceOfSender() external view returns (uint256) {
        return msg.sender.balance;
    }

    // For testing
    function NativeBalanceOfThisHandler() external view returns (uint256) {
        return address(this).balance;
    }
}

contracts/interface/IBridge.sol.content:
// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity ^0.8.4;

/**
    @title Interface for Bridge contract.
 */
interface IBridge {
    struct CallRemoteParam {
        bytes32 resourceID;
        uint32 targetChainId;
        address target;
        bytes data;
    }

    function callRemote(
        bytes32 resourceID,
        uint32 targetChainId,
        address target,
        bytes calldata data
    ) external payable returns (bytes32);

    event CallRequest(
        bytes32 resourceID,
        address caller,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 indexed messageId,
        uint32 indexed targetChainId,
        address indexed target,
        bytes data
    );

    event ConfirmedRequest(
        bytes32 resourceID,
        address caller,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 indexed messageId,
        uint32 indexed targetChainId,
        address indexed target,
        bytes data
    );

    function execute(
        bytes32 resourceID,
        uint32 sourceChainId,
        uint256 sourceNonce,
        bytes32 messageId,
        uint32 targetChainId,
        address target,
        bytes calldata data,
        bytes[] calldata signatures
    ) external;
}

