// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ERC20Handler is Ownable {
    // ResourceID
    bytes32 public resourceID;

    // bridge contract address
    address public bridgeAddress;

    // Cross chain token contract address
    address public tokenAddress;

    // Erc20 handler address on the target chain
    address public targetHandler;

    // Do cross chain tokens need burn
    bool public burnable;

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        resourceID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Set up
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Deposit
    function deposit(
        bytes32 _resourceID,
        uint32 targetChainId,
        uint256 amount
    ) public returns (bytes32) {
        require(resourceID == _resourceID, "resourceID error");

        IERC20 erc20 = IERC20(tokenAddress);
        require(erc20.balanceOf(msg.sender) >= amount, "Insufficient funds");

        if (burnable) {
            // burn
            IERC20Burnable erc20Burn = IERC20Burnable(tokenAddress);
            erc20Burn.burnFrom(msg.sender, amount);
        } else {
            // lock
            erc20.transferFrom(msg.sender, address(this), amount);
        }

        bytes memory data = abi.encode(msg.sender, amount);
        // Call bridge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    function execute(bytes32 _resourceID, bytes calldata data) public {
        require(resourceID == _resourceID, "resourceID error");

        uint256 amount;
        address sender;
        (sender, amount) = abi.decode(data, (address, uint256));
        if (burnable) {
            // mint
            IERC20Mintable erc20mint = IERC20Mintable(tokenAddress);
            erc20mint.mint(sender, amount);
        } else {
            // release
            IERC20 erc20 = IERC20(tokenAddress);
            erc20.transfer(sender, amount);
        }
    }
}

