// SPDX-License-Identifier: LGPL-3.0-only
pragma solidity 0.8.4;

import "../interface/IBridge.sol";
import "../interface/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";

contract ERC721Handler is Ownable, ERC721Holder {
    // ResourceID
    bytes32 public resourceID;

    // BresourceIDge contract address
    address public bridgeAddress;

    // Cross chain token contract address
    address public tokenAddress;

    // Erc721 handler address on the target chain
    address public targetHandler;

    // Do cross chain tokens need burn
    bool public burnable;

    event ERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes data
    );

    // Initializes Manager
    constructor(
        bytes32 _resourceID,
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) {
        resourceID = _resourceID;
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Set up
    function adminSetConfig(
        address _bridgeAddress,
        address _tokenAddress,
        address _targetHandler,
        bool _burnable
    ) public onlyOwner {
        bridgeAddress = _bridgeAddress;
        tokenAddress = _tokenAddress;
        targetHandler = _targetHandler;
        burnable = _burnable;
    }

    // Deposit
    function deposit(
        bytes32 _resourceID,
        uint32 targetChainId,
        uint256 tokenID
    ) public returns (bytes32) {
        require(resourceID == _resourceID, "resourceID error");

        bytes memory metaData;
        IERC721Metadata erc721Metadata = IERC721Metadata(tokenAddress);
        metaData = bytes(erc721Metadata.tokenURI(tokenID));

        if (burnable) {
            ERC721Burnable erc721Burn = ERC721Burnable(tokenAddress);
            erc721Burn.burn(tokenID);
        } else {
            IERC721 erc721 = IERC721(tokenAddress);
            erc721.transferFrom(msg.sender, address(this), tokenID);
        }

        bytes memory data = abi.encode(msg.sender, tokenID, metaData);

        // Call bresourceIDge
        IBridge bridge = IBridge(bridgeAddress);
        bytes32 messageId = bridge.callRemote(
            resourceID,
            targetChainId,
            targetHandler,
            data
        );

        return messageId;
    }

    function execute(bytes32 _resourceID, bytes calldata data) public {
        require(resourceID == _resourceID, "resourceID error");
        address sender;
        uint256 tokenID;
        bytes memory metaData;
        (sender, tokenID, metaData) = abi.decode(
            data,
            (address, uint256, bytes)
        );
        if (burnable) {
            // mint
            IERC721PresetMinterPauserAutoId erc721Preset = IERC721PresetMinterPauserAutoId(
                    tokenAddress
                );
            erc721Preset.mint(sender);
        } else {
            // release
            IERC721 erc721 = IERC721(tokenAddress);
            erc721.transferFrom(address(this), sender, tokenID);
        }
    }

//    function onERC721Received(
//        address operator,
//        address from,
//        uint256 tokenId,
//        bytes calldata data
//    ) public returns (bytes4) {
//        emit ERC721Received(operator, from, tokenId, data);
//        return this.onERC721Received.selector;
//    }
}

